I never understood page requirements. "Write a bazillion page essay on the nuance of this old ass book." It's supposed to encourage you to not half-ass it, actually put though into what your writing, but i think it backfires. It promotes adding "fluff," ultimately useless information, phrasing, or grammar just to make it to 10,000 words. It's not my fault I can tick all other boxes whilst still remaining short enough for you to not have to block out an afternoon to finish. I always appreciate things that are straightforward. This could just be me acting salty about having to write another essay, but who cares, my fingers hurt.

Still IN! 8 days left, lets go!, Gold no nutter if I where to fail right now, however I will not fail, I promised to avenge my fallen cumrades and that is what I am planning to do

